import React, { Component } from 'react';
import { Navbar } from "../../node_modules/react-bootstrap";
import { createBrowserHistory } from '../../node_modules/react-history';
import { Router, Link } from '../../node_modules/react-router-dom';

class Navigation extends Component {
    constructor(props) {
        super(props);
        this.state = {
            history: createBrowserHistory()
        };
    }

    render() {

        return (
            <React.Fragment>
                <Navbar bg="dark" variant="dark">
                    <Navbar.Brand>BOND PRICING</Navbar.Brand>
                    <Router history={this.state.history}>
                        <Link to={"/valuation"}></Link>
                    </Router>

                </Navbar>
            </React.Fragment>
        )
    }
}

export default Navigation;
